//descativer le scroll de la page dès le début de son chargement !
document.body.style.overflow = "hidden";
//Créer une isntance du loader conatiner !
const loaderContainer = document.querySelector(".loaderContainer");
//Faire disparaitre le loader te son container dès que la page est complètement chargée !
//faire fondre le loader et son conteneur !
loaderContainer.classList.add("fonduOut");

setTimeout(() => {
    loaderContainer.classList.add("hidden");
}, 400);

const fond = document.querySelector(".fond");

fond.innerHTML = "<img class=\"earth\" src=\"data:image/png;base64,\"/> <input type=\"file\" name=\"\" id=\"\" class=\"fileInput\">";

var fileInput = document.querySelector(".fileInput");

fileInput.style.display = "none";
fileInput.style.position = "absolute";
fileInput.style.left = "50%";
fileInput.style.top = "50%";
fileInput.style.transform ="translate(-50%,-50%)";

var earth = document.querySelector(".earth");
earth.style.zIndex = "1";
earth.style.position = "absolute";
earth.style.left = "50%";
earth.style.top = "50%";
earth.style.transform ="translate(-50%,-50%)";

earth.style.cursor = "pointer";


earth.addEventListener("click",(e)=>{
    fileInput.click();
});

if(window.innerHeight < window.innerWidth)
{
    earth.style.width="100vh";
}
else
{
    earth.style.width="100vw";
}


earth.classList.add("rotationMove");


